import React, { useEffect, useState } from "react";
import Header from "./Header";
import { Link } from "react-router-dom";
import axios from "axios";


const Showservices = () => {

    const [service, setService] = useState([])
    const token = localStorage.getItem("token");
    // console.log("token: ", token);
    useEffect(()=>{
        axios.get('http://192.168.1.111:8000/admin/servicesdata', { headers: { token } }).then(function (response) {
            // handle success
            console.log(response.data);
            setService(response.data.servicedata)
            // console.log("Service:", service);

        })
            .catch(function (error) {
                // handle error
                console.log(error);
            })
    },[])

    return (
        <>
            <Header />
            <div>
                <main id="main" className="main">
                    <div className="pagetitle">
                        <h1 className="text-start">Show Services</h1>
                        <nav>
                            <ol className="breadcrumb">
                                <li className="breadcrumb-item">Home</li>
                                <li className="breadcrumb-item active">Services</li>
                            </ol>
                        </nav>
                    </div>{/* End Page Title */}
                    <section className="section dashboard">
                        <div className="row">
                            {/* Left side columns */}
                            <div className="col-lg-12">
                                <div className="row">
                                    <div className="col-12">
                                        <div className="card recent-sales overflow-auto">
                                            <div className="card-body">
                                                <h5 className="card-title">Show All Services</h5>
                                                <table class="rwd-table">
                                                    <tbody>
                                                        <tr>
                                                            <th>Services Number</th>
                                                            <th>Services Name</th>
                                                            <th>Services Details</th>
                                                            <th>Provider Email</th>
                                                            <th>Services Image</th>
                                                            <th>Show Details</th>
                                                        </tr>
                                                        {service.map((e)=>{
                                                            return(
                                                            

                                                                <p>{e.service[0].addservi}</p>
                                                                
                                                            );
                                                        })}
                                                        <tr>
                                                        <td data-th="Supplier Code">
                                                        </td>
                                                        <td data-th="Supplier Name">
                                                            UPS
                                                        </td>
                                                        <td data-th="Invoice Number">
                                                            ASDF19218
                                                        </td>
                                                        <td data-th="Invoice Date">
                                                            06/25/2016
                                                        </td>
                                                        <td data-th="Due Date">
                                                            12/25/2016
                                                        </td>
                                                        <td data-th="Net Amount">
                                                            <Link to="">
                                                            <button type="button" class="btn btn-primary btn-sm">Show All Details</button>
                                                            </Link>
                                                        </td>
                                                        </tr>
                                                    </tbody>
                                                </table>

                                            </div>
                                        </div>
                                    </div>
                                </div>
                            </div>
                        </div>
                    </section>
                </main>{/* End #main */}
                {/* ======= Footer ======= */}
                <footer id="footer" className="footer">
                    <div className="copyright">
                        Â© Copyright <strong><span>Sky Digital</span></strong>. All Rights Reserved
                    </div>
                    <div className="credits">
                        Designed by <a href="https://skydigitalgrapgics.in/">Dharmik Manguliya</a>
                    </div>
                </footer>{/* End Footer */}
                <a href="#" className="back-to-top d-flex align-items-center justify-content-center"><i className="bi bi-arrow-up-short" /></a>
            </div>
        </>
    )
}

export default Showservices
